Information
------------------------------

Secrets of the Dead: The Silver Pharaoh
The royal tomb of Pharaoh Psusennes I is one of the most spectacular of all the ancient Egyptian treasures even more remarkable than that of Tutankhamen. So why hasn't the world heard about it? Archaeologists, using the hieroglyphs inside the tomb, pieced together the identity of the pharaoh, and further investigation reveals political intrigue, a lost city, and a leader who united a country in turmoil and became the Silver Pharaoh. Narrated by Leiv Schreiber

